import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './pages/HomePage';
import PointsPage from './pages/PointsPage';
import DeliveriesPage from './pages/DeliveriesPage';
import UsersPage from './pages/UsersPage';
import DashboardPage from './DashboardPage';
import LoginPage from './pages/LoginPage';
import PrivateRoute from './components/PrivateRoute';
import { getCurrentUser, clearAuth } from './auth';

function App() {
  const user = getCurrentUser();

  const handleLogout = () => {
    clearAuth();
    window.location.href = '/login';
  };

  return (
    <Router>
      <div className="d-flex flex-column min-vh-100">
        <nav className="navbar navbar-expand-lg navbar-dark bg-success">
          <div className="container-fluid">
            <Link className="navbar-brand" to="/">EcoRecicla</Link>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav me-auto">
                {user && (
                  <>
                    <li className="nav-item"><Link className="nav-link" to="/dashboard">Dashboard</Link></li>
                    <li className="nav-item"><Link className="nav-link" to="/points">Pontos de Coleta</Link></li>
                    <li className="nav-item"><Link className="nav-link" to="/deliveries">Entregas</Link></li>
                    <li className="nav-item"><Link className="nav-link" to="/users">Usuários</Link></li>
                  </>
                )}
              </ul>
              <ul className="navbar-nav ms-auto">
                {!user && (
                  <li className="nav-item">
                    <Link className="nav-link" to="/login">Login</Link>
                  </li>
                )}
                {user && (
                  <li className="nav-item d-flex align-items-center">
                    <span className="navbar-text me-2">
                      Olá, {user.name}
                    </span>
                    <button className="btn btn-outline-light btn-sm" onClick={handleLogout}>
                      Sair
                    </button>
                  </li>
                )}
              </ul>
            </div>
          </div>
        </nav>

        <main className="container my-4 flex-grow-1">
          <Routes>
            <Route path="/login" element={<LoginPage />} />
            <Route path="/" element={
              <PrivateRoute>
                <HomePage />
              </PrivateRoute>
            } />
            <Route path="/dashboard" element={
              <PrivateRoute>
                <DashboardPage />
              </PrivateRoute>
            } />
            <Route path="/points" element={
              <PrivateRoute>
                <PointsPage />
              </PrivateRoute>
            } />
            <Route path="/deliveries" element={
              <PrivateRoute>
                <DeliveriesPage />
              </PrivateRoute>
            } />
            <Route path="/users" element={
              <PrivateRoute>
                <UsersPage />
              </PrivateRoute>
            } />
          </Routes>
        </main>

        <footer className="bg-light text-center py-3">
          <small>EcoRecicla - ODS 11: Cidades e Comunidades Sustentáveis</small>
        </footer>
      </div>
    </Router>
  );
}

export default App;
